// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import Button from 'react-bootstrap/Button';
import './Main.scss';

class Main extends React.Component {

  constructor() {
    super();

    this.state = {
      ArticlesPopulaire: [],
    };
  }

  componentDidMount() {
    axios.get("http://localhost:8000/").then((data) => {
      //console.log(data.data);
      this.setState({
        ArticlesPopulaire: data.data,        
      })
      console.log(data);
    }).catch(function(error) {
      if (!error.status) {
        console.log(error);
      }
    })
  }

  render() {
    return (
      <div className="div_main">
        <Fade>
          <h1 className="h1_nom-prenom">Fiona Battaglia</h1>
        </Fade>
      </div>
    );
  }
}

export default Main;
